import React from 'react';
import Header from '../components/Header';
import Sidebar from '../components/Sidebar';
import MainConfig from '../components/MainConfig';
import BotStatus from '../components/BotStatus';
import Products from '../components/Products';

const ConfigPage: React.FC = () => {
  return (
    <div>
      <Header />
      <div className="flex">
        <Sidebar selected="config" />

        <div className="flex-grow bg-blue-300 p-6">
          {/* Header interior */}
          <div className="flex justify-between items-center mb-3">
            <h2 className="text-2xl font-poppins font-bold mt-2 ">
              Configuración de Chatbot
            </h2>
            <BotStatus />
          </div>

          {/* Resto de la configuración */}
          <div className="flex gap-3 flex-wrap">
            <div className="flex-1 md:flex-[0_0_70%]">
              <MainConfig />
            </div>
            <div className="flex-1 md:flex-[0_0_30%]">
              <Products />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ConfigPage;
